def full_route_calc(): #returns full route json with right and left tracks
    full_route = []
    point = {}
    i = 0
    #for point in route:
    while i<len(route)-1:
        a = route[i]
        b = route[i+1]
#        print a,b
        if a == b: #check if current and future coordinates are not the same to avoid devision by zero
            i = i+1
        else:
            full_route_dict = calc_azimuth_right_left(a.get('lat'),a.get('lon'),b.get('lat'),b.get('lon'))
            #print full_route_dict
            #print full_route
            full_route.append(full_route_dict)
            #print full_route
            i = i+1
    return full_route

def cut_tracks_separatly(point): #returns separate tracks for left and right
    for i in point:
        current_track = []
        a = i.get('cur_lat')
        b = i.get('cur_lon')
        current_track.append(i.get('lat:', a))
        route.append(i.get('lon:', b))

    for i in point:
        right_track = []
        a = i.get('latr')
        b = i.get('lonr')
        right_track.append(i.get('latr:', a))
        right_track.append(i.get('lonr:', b))

    for i in point:
        left_track = []
        a = i.get('latl')
        b = i.get('lonl')
        left_track.append(i.get('latl:', a))
        left_track.append(i.get('lonl:', b))

    return(current_track, left_track,right_track)